import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './App.css';

const Step2 = () => {
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [vehicles, setVehicles] = useState([]);
  const [filteredVehicles, setFilteredVehicles] = useState([]);
  const [filters, setFilters] = useState({
    minPrice: '',
    maxPrice: '',
    minYear: '',
    maxYear: ''
    // Add more filters as needed
  });

  useEffect(() => {
    const fetchVehicles = async () => {
      try {
        const step2Data = JSON.parse(localStorage.getItem('step2Data'));
        const token = localStorage.getItem('token');

        const response = await axios.get(`https://calm-retreat-90846-cd036e8a822e.herokuapp.com/https://api.rentsyst.com/v2/booking/search`, {
          params: {
            date_from: step2Data.pickupDateTime,
            date_to: step2Data.returnDateTime,
            pickup_location: step2Data.selectedLocation,
            return_location: step2Data.selectedLocation
          },
          headers: {
            Authorization: `Bearer ${token}`
          }
        });

        console.log('Response data:', response.data);

        const availableVehicles = response.data.available_vehicles || [];
        setVehicles(availableVehicles);
        setFilteredVehicles(availableVehicles);
      } catch (error) {
        console.error('Error fetching vehicles:', error);
        setError('Failed to fetch vehicles: ' + error.message);
      } finally {
        setLoading(false);
      }
    };

    fetchVehicles();
  }, []);

  const applyFilters = () => {
    let filtered = vehicles.filter(vehicle => {
      // Apply filters here
      return (
        (!filters.minPrice || vehicle.price >= filters.minPrice) &&
        (!filters.maxPrice || vehicle.price <= filters.maxPrice) &&
        (!filters.minYear || vehicle.year >= filters.minYear) &&
        (!filters.maxYear || vehicle.year <= filters.maxYear)
        // Add more filter conditions as needed
      );
    });
    setFilteredVehicles(filtered);
  };

  const resetFilters = () => {
    setFilters({
      minPrice: '',
      maxPrice: '',
      minYear: '',
      maxYear: ''
      // Reset other filters as needed
    });
    setFilteredVehicles(vehicles);
  };

  const handleFilterChange = (e) => {
    const { name, value } = e.target;
    setFilters({ ...filters, [name]: value });
  };

  return (
    <div className="step2">
      <div className="sidebar">
        <h3>Filter</h3>
        <label>Min Price:</label>
        <input type="number" name="minPrice" value={filters.minPrice} onChange={handleFilterChange} />
        <label>Max Price:</label>
        <input type="number" name="maxPrice" value={filters.maxPrice} onChange={handleFilterChange} />
        <label>Min Year:</label>
        <input type="number" name="minYear" value={filters.minYear} onChange={handleFilterChange} />
        <label>Max Year:</label>
        <input type="number" name="maxYear" value={filters.maxYear} onChange={handleFilterChange} />
        <button onClick={applyFilters}>Apply Filters</button>
        <button onClick={resetFilters}>Reset Filters</button>
      </div>
      <div className="catalog">
        <h2>Available Vehicles</h2>
        {loading && <p>Loading...</p>}
        {error && <p>{error}</p>}
        {!loading && !error && filteredVehicles.length === 0 && <p>No vehicles available</p>}
        {!loading && !error && filteredVehicles.length > 0 && (
          <div className="vehicle-list">
            {filteredVehicles.map(vehicle => (
              <div key={vehicle.id} className="vehicle-item">
                <div className="vehicle-thumbnail">
                  <img src={vehicle.thumbnail} alt={vehicle.mark} />
                </div>
                <div className="vehicle-details">
                  <h3>{vehicle.mark}</h3>
                  <p>Year: {vehicle.year}</p>
                  <p>Price: {vehicle.price} {vehicle.currency}</p>
                  {/* Add more vehicle details as needed */}
                </div>
              </div>
            ))}
          </div>
        )}
      </div>
    </div>
  );
};

export default Step2;
